io.on('connection', (socket) => {
    let a = crypto.util.generatePRFKey(256);
    let server_prod = new Number('1');
    let sender;

    socket.on('oprfRound', (index) => {
        let m_0 = a[index];
        let m_1 = a[index].multiply(OPRF_KEY[index]).mod(MOD);

        server_prod = server_prod.multiply(m_0).mod(MOD);

        sender = new crypto.ObliviousTransferSender(m_0, m_1, null, null);
        socket.emit("serverKey", sender.C.hex);
    })

    socket.on("requestServerProd", () => {
        let server_prod_inv = server_prod.modInverse(MOD);
        socket.emit("serverProd", server_prod_inv.hex)
    })

    socket.on("clientKey", (data) => {
        console.log('CLIENT KEY:', data);
        let clientKey = new Number(data, 16);
        sender.generateKeys(clientKey);
        let [e_0, e_1] = sender.encryptMessages();
        let pair_0 = e_0.map(x => x.hex);
        let pair_1 = e_1.map(x => x.hex);

        socket.emit("ciphertexts", [pair_0, pair_1])
    })
});



